import Header from '../comps/Header';
import {css, cx} from 'emotion';

const layoutStyle = {
    margin: 0,
    padding:0,
    background: '#EAE0D5',
    color: '#0A0908'
};

const Layout = props => (
    <div style={layoutStyle}>
        <Header />
        {props.children}
    </div>
)

export default Layout;
